// DeleteUniqueIndexCache 删除索引存在的缓存
func (d *DictDatumRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.DictDatum) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, d.cache.Key(CacheDictDatumByConditionPrefix))
	keys = append(keys, d.cache.Key(CacheDictDatumUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[d.cache.Key(CacheDictDatumByIDPrefix, item.ID)] = struct{}{}
			KeyMap[d.cache.Key(CacheDictDatumUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[d.cache.Key(CacheDictDatumByTypeKeyPrefix, item.Type, item.Key)] = struct{}{}
			KeyMap[d.cache.Key(CacheDictDatumUnscopedByTypeKeyPrefix, item.Type, item.Key)] = struct{}{}
			KeyMap[d.cache.Key(CacheDictDatumByTypePrefix, item.Type)] = struct{}{}
			KeyMap[d.cache.Key(CacheDictDatumUnscopedByTypePrefix, item.Type)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := d.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
